export const Projects = () => {

  const projects = [
    {
      title: "Project 1",
      description: "Description 1",
      imgUrl: projImg1,
    },
    {
      title: "Project 2",
      description: "Description 2",
      imgUrl: projImg1,
    },
    {
      title: "Project 3",
      description: "Description 3",
      imgUrl: projImg1,
    },
  ]
  return (
    <section className="project" id="project">
      <Container>
        <Row>
          <Col>
            <h2>Projects</h2>
            <p>Description</p>

          </Col>
        </Row>
      </Container>
    </section>
  )
}
